function ExpenseItem() {
  return (
    <div>
      <div className="expense-item">
        <div>March 28 2012</div>
        <div className="expense-item__description">
          <h2>car insurance</h2>
          <div className="expense-item__price">$1550.22</div>
        </div>
      </div>
      <div className="expense-item">
